import React from 'react';
import './Main.css'

//components
import Section from './Section/Section';
import Blurb from './Blurbs/Blurb';


const Main = () => {
    return (
    <div className="container">
        <Section id='aboutme'
        children={<Blurb title={'title'}/>}/>
        <Section id='skills' children={<Blurb title={'title'}/>}/>
        <Section id='projects' children={<Blurb title={'title'}/>}/>
    </div>
    );
}

export default Main;
